import React from 'react';
import  Aux from '../../hoc/aux'

const layout =(probs) => {
    // eslint-disable-next-line no-unused-expressions
    <Aux>
        <div>
            Toobar, SideDrawer , Backdrop
        </div>
        <main>
            {probs.children}
        </main>
    </Aux>
}

export default layout;
